import React from 'react';
import HomeHeader from './PostSection/HomeHeader';
import Post from './PostSection/Post';
import Suggestion from './Suggestion';
import Profile from './ProfileSection/Profile';
import Footer from './footerSection/Footer';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';

function Main() {
    return (
        <div>
            <BrowserRouter>
            <Routes>
                <Route path='/' element={<Navigate to='/postsection'/>}/>
                <Route path='/posts' element={<Navigate to='/postsection'/>}/>
            </Routes>
            </BrowserRouter>
            <div
                className="main"
                style={{ display: 'flex'}}
            >
               <div style={{width:'30%'}}>
                {/* <Profile /> */}
               </div>
               <div style={{width:'50%'}}>
                <HomeHeader/>
               <Post />
               <Footer/>
               </div>
               <div style={{width:'30%'}}>
                {/* <Suggestion /> */}
               </div>
            </div>
        </div>
    );
}

export default Main;
